    return( 
    <>
    <NavLink className={({ isActive }) => isActive ? "active_class" : undefined} to="/">About Us</NavLink>
    <NavLink className={({ isActive }) => isActive ? "active_class" : undefined} to="/contact">Contact Us</NavLink>
    <NavLink className={({ isActive }) => isActive ? "active_class" : undefined} to="/pikachu">Pikachu</NavLink>
    <NavLink className={({ isActive }) => isActive ? "active_class" : undefined} to="/service">Service</NavLink>
    <NavLink className={({ isActive }) => isActive ? "active_class" : undefined} to="/search">Search</NavLink>
    <NavLink className={({ isActive }) => isActive ? "active_class" : undefined} to="/">Result</NavLink>
    {/* <Link>pikachu</Link> */}
    {/* <a href="/">About Us</a>
    <a href="/contact">Contact Us</a>
    <a href="/pikachu">Pikachu</a> */}
    </>);
}
export default NavBar;
